import org.apache.spark.streaming._

@transient val ssc = new StreamingContext(sc, Seconds(4))
ssc.checkpoint("hdfs://lambda-pluralsight:9000/spark/checkpoint")

val inputPath = "file:///vagrant/input"
val textDStream = ssc.textFileStream(inputPath)
val activityStream = textDStream.transform( input => {
  input.flatMap{ line =>
    val record = line.split("\\t")
    val MS_IN_MIN = 1000 * 60
    if (record.length == 7)
      Some(Activity(record(0).toLong / MS_IN_MIN * MS_IN_MIN, record(1), record(2), record(3), record(4), record(5), record(6)))
    else
      None
  }
} ).cache()

import com.twitter.algebird._
import org.apache.spark.streaming.State

case object functions {
    def mapVisitorsStateFunc = (k: (String, Long), v: Option[HLL], state: State[HLL]) => {
      val currentVisitorHLL = state.getOption().getOrElse(new HyperLogLogMonoid(12).zero)
      val newVisitorHLL = v match {
        case Some(visitorHLL) => currentVisitorHLL + visitorHLL
        case None => currentVisitorHLL
      }
      state.update(newVisitorHLL)
      val output = newVisitorHLL.approximateSize.estimate
      output
    }
}

  import com.twitter.algebird._
  import org.apache.spark.streaming.State
  
      // unique visitors by product
      @transient val visitorStateSpec =
        StateSpec
        .function(functions.mapVisitorsStateFunc)
        .timeout(Minutes(120))

      @transient val statefulVisitorsByProduct = activityStream.map( a => {
        ((a.product, a.timestamp_hour), new HyperLogLogMonoid(12)(a.visitor.getBytes))
      } ).mapWithState(visitorStateSpec)

      val visitorStateSnapshot = statefulVisitorsByProduct.stateSnapshots()
      visitorStateSnapshot.cache()
      visitorStateSnapshot
//        .reduceByKeyAndWindow(
//          (a, b) => b,
//          (x, y) => x,
//          Seconds(28)
//        ) // only save or expose the snapshot every x seconds
        .foreachRDD{ rdd =>
          val df = rdd
            .map(sr => VisitorsByProduct(sr._1._1, sr._1._2, sr._2.approximateSize.estimate))
            .toDF()
  
          df.registerTempTable("VisitorsByProductHLL")
          sqlContext.cacheTable("VisitorsByProductHLL")
      }
      
    // Calculate precise uniques for comparision by keeping entire state in memory
      activityStream.map ( a => {
        ((a.product, a.timestamp_hour), a.visitor)
      } ).updateStateByKey((newItemsPerKey: Seq[String], currentState: Option[(Long, Seq[String])]) => {
        val (prevTimestamp, prevVisitorList) = currentState.getOrElse((System.currentTimeMillis(), List[String]()))
        var result : Option[(Long, Seq[String])] = null

        if (newItemsPerKey.isEmpty){
          if(System.currentTimeMillis() - prevTimestamp > 1000 * 60 * 120 + 4000)
            result = None
          else
            result = Some((prevTimestamp, prevVisitorList))
        } else {
          result = Some((System.currentTimeMillis(), prevVisitorList ++ newItemsPerKey))
        }
        result
      }).foreachRDD{ rdd =>
        val df = rdd
          .map(sr => VisitorsByProduct(sr._1._1, sr._1._2, sr._2._2.length))
          .toDF()
        df.registerTempTable("VisitorsByProduct")
        sqlContext.cacheTable("VisitorsByProduct")
      }

ssc.start()
